import React from 'react';
import { useRoutes, useNavigate } from 'react-router-dom';
import Home from 'pages/Home';
import NotFound from 'pages/NotFound';
import PainelPrincipal from 'pages/PainelPrincipal';
import Ordens from 'pages/Ordens';
import Cadastro from 'pages/Cadastro';
import EditarOrdem from 'pages/EditarOrdem';
import PainelUsuarios from 'pages/PainelUsuarios';
import EditarUsuario from 'pages/EditarUsuario';
import CadastrarUsuario from 'pages/CadastrarUsuario';
import Login from 'pages/Login';
import ResultadoUsuariosPage from 'pages/ResultadoUsuariosPage';
import PrivateRoute from './PrivateRoute';

const ProjectRoutes = () => {
  let navigate = useNavigate();

  const handleLoginSuccess = () => {
    console.log("Usuário logado com sucesso!");
    navigate('/painelprincipal'); // Redireciona para a página principal após o login
  };

  let element = useRoutes([
    { path: '/', element: <Login onLogin={handleLoginSuccess} /> },
    { path: '*', element: <NotFound /> },
    { path: '/login', element: <Login onLogin={handleLoginSuccess} /> },
    { path: '/painelprincipal', element: <PrivateRoute component={PainelPrincipal} /> },
    { path: '/ordens', element: <PrivateRoute component={Ordens} /> },
    { path: '/cadastro', element: <PrivateRoute component={Cadastro} /> },
    { path: '/editarordem', element: <PrivateRoute component={EditarOrdem} /> },
    { path: '/painelusuarios', element: <PrivateRoute component={PainelUsuarios} /> },
    { path: '/editarusuario', element: <PrivateRoute component={EditarUsuario} /> },
    { path: '/cadastrarusuario', element: <PrivateRoute component={CadastrarUsuario} /> },
    { path: '/resultado-usuarios', element: <PrivateRoute component={ResultadoUsuariosPage} /> },
  ]);

  return element;
};

export default ProjectRoutes;
